import React from "react";
import { Link } from "react-router-dom";

const DashboardActions = () => {
  return (
    <div className="flex flex-col space-y-3">
      <Link
        to="/edit-profile"
        className="flex items-center justify-start bg-blue-500 text-white py-1 px-3 rounded-lg shadow-sm hover:bg-blue-400 transition duration-300"
      >
        <i className="fas fa-user-circle text-yellow-300 text-lg mr-2"></i>
        <span className="font-medium">Edit Profile</span>
      </Link>
      <Link
        to="/add-experience"
        className="flex items-center justify-start bg-green-500 text-white py-1 px-3 rounded-lg shadow-sm hover:bg-green-400 transition duration-300"
      >
        <i className="fab fa-black-tie text-yellow-300 text-lg mr-2"></i>
        <span className="font-medium">Add Experience</span>
      </Link>
      <Link
        to="/add-education"
        className="flex items-center justify-start bg-red-500 text-white py-1 px-3 rounded-lg shadow-sm hover:bg-red-400 transition duration-300"
      >
        <i className="fas fa-graduation-cap text-yellow-300 text-lg mr-2"></i>
        <span className="font-medium">Add Education</span>
      </Link>
    </div>
  );
};

export default DashboardActions;
